<?php

use Codeception\Test\Unit;
use Del\Image;

class ImageTest extends Unit
{
    /**
     * @var \UnitTester
     */
    protected $tester;

    protected function _before()
    {
    }

    protected function _after()
    {
    }


    public function testLoadImageFromConstructor()
    {
        $path = 'tests/_data/sonsofanarchy.jpg';
        $image = new Image($path);
        $output = base64_encode($image->output(true));
        $this->assertEquals($this->getBase64JpgString(), $output);
    }


    public function testLoadImage()
    {
        $path = 'tests/_data/sonsofanarchy.jpg';
        $image = new Image();
        $image->load($path);
        $output = base64_encode($image->output(true));
        $this->assertEquals($this->getBase64JpgString(), $output);
    }


    public function testLoadPng()
    {
        $path = 'tests/_data/bonemvc.png';
        $image = new Image();
        $image->load($path);
        $output = base64_encode($image->output(true));
        $this->assertEquals($this->getBase64PngString(), $output);
    }


    public function testLoadGif()
    {
        $path = 'tests/_data/jim.gif';
        $image = new Image();
        $image->load($path);
        $output = base64_encode($image->output(true));
        $this->assertEquals($this->getBase64PngString(), $output);
    }

    private function getBase64JpgString()
    {
        return '';
    }


    private function getBase64PngString()
    {
        return '';
    }




    private function getBase64GifString()
    {
        return '';
    }

}